    .style("font-size", "8.5px")
    .style("text-anchor", "middle")
    .style("font-weight", "normal")
    .text(function(d) { return d.split("-")[0]; })

    .append("tspan")
    .style("fill", "#ff7c39")
    .style("font-weight", "normal")
    .text(function(d) { return d.split("-")[1]; })

    .append("tspan")
    .style("fill", "var(--col-6)")
    .style("font-weight", "normal")
    .text(function(d) { return d.split("-")[2]; });


var svg = d3.select(".moonphasexx")
    .append("svg")
    //.style("background", "#292e35")
    .attr("width", 110)
    .attr("height", 110);

var w = 110;
var h = 110;
var radius = w / 2 * 0.91;
var gradient = 2;
var mAxis = <?php echo $alm["parallacticAngle"];?>;
var moonface = "#high-res-moon";

function getX(phase, angle) {
    const f = Math.cos(toRadians(phase));

    let x;
    const cosi = Math.cos(toRadians(angle));
    x = f * radius * cosi + w / 2;

    if((phase <= 180 && cosi < 0) || (phase > 180 && cosi > 0)) {
        x = radius * cosi + w / 2;
    }
    return x;    
}

function drawDarkSide(phase) {
    const gradientPoints = [];

    let x = getX(phase - gradient, 0);
    let y = radius * Math.sin(0) + h / 2;

    var path = d3.path();
    path.moveTo(x, y);

    for(let i = 0; i <= 360; i += 1) {
        x = getX(phase + gradient, i);
        let x2 = getX(phase - gradient, i);

        if(phase > 180) {
            const temp = x;
            x = x2;
            x2 = temp; 
        }
        y = radius * Math.sin(toRadians(i)) + h / 2;

        gradientPoints.push([x, x2, y, phase]);

        path.lineTo(x, y);
    }
    path.closePath();
    svg.append("path")
    .attr("d", path)
    .style('fill');
    return gradientPoints;
}
 
function fillGradient(points) {  

    if(Math.abs(points[0][3] - 180) <= gradient) {
         return;
    } 
    for(let i = 0; i < points.length - 1; i++) {
        let x1 = points[i][0];
        let x2 = points[i][1];
        let y1 = points[i][2];
        let y2 = points[i+1][2];

        if(points[i][3] > 180) {
            x1++;
        }
    }
}

function drawPhase(phase) {
    svg.attr("transform", "rotate("+ mAxis +", 0, 0)")
    .style('fill', 'rgba(41, 46, 53, 0.8)');
    const gradientPoints = drawDarkSide(phase);
    fillGradient(gradientPoints);

}

function display(phase) {
/*
    svg
        .append('image') // image output
        .attr('xlink:href', moon)
        .attr('width', 100)
        .attr('height', 100)
        .attr('x', 5.1)
        .attr('y', 5);
*/
    svg
        .append("use")
        .attr("xlink:href", moonface)
        .attr("width", 99.9)
        .attr("height", 99.9)
        .attr('x', 5.03)
        .attr('y', 5);

  drawPhase(phase);    
}

phase = <?php echo $alm["moon_ecliptic_angle"];?>;
display(phase);

</script>
